import React from 'react';

const About = ({ setCurrentPage }) => {
  const handleLinkClick = (page) => {
    setCurrentPage(page);
  };

  return (
      <header>
        <h1>About me</h1>
      <nav>
        <ul>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('home')}
            >
              Home
            </button>
          </li>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('about')}
            >
              About
            </button>
          </li>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('projects')}
            >
              Projects
            </button>
          </li>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('contact')}
            >
              Contact
            </button>
          </li>
        </ul>
      </nav>

      <div style={bioBoxStyle}>
        <img
          src={require('./images/me.png')}
          alt="Me"
          style={bioimage}
        />
        <p>
          My name is Alex Baptista, and I am an early career full stack software developer. I graduated from 
          Penn State Main Campus in May 2023 from the College of Engineering with a bachelors degree in Computer Science and 
          a minor in Planetary Science and Astronomy.
        </p>
        <p></p>
        <p>
          While at Penn State, I was accepted into the co-ed business fraternity Phi Chi Theta, Alpha Iota chapter in the Fall 2019 of my freshman year. 
          As a member of Phi Chi Theta I worked with like minded professionally oriented students to develop our business skills
          and grow my professional network. During my four years in this orginization I mentored younger members who were engineering
          majors with resume reviews and mock interviews. 
        </p>
        <p>
          For two years, I was Phi Chi Theta's Family Relations chair. plays a vital role in fostering a positive and supportive 
          environment for the families impacted by pediatric cancer within the THON community. They work to ensure that the families feel valued, 
          heard, and supported throughout their journey, while also facilitating meaningful connections between the families and THON volunteers.
          I also had the honor of dancing in THON 2023. Being a member of Phi Chi Theta and Family Relations chair has been by far the most
          rewarding experience of my life and I owe much of who I am today to all my friends in Phi Chi Theta.
        </p>
      </div>

      <div style={imageContainerStyle}>
        <img
          src={require('./images/psu.png')}
          alt="Psu"
          style={imageStyle}
        />
        <img
          src={require('./images/fightins.png')}
          alt="Phillies"
          style={imageStyle}
        />
        <img
          src={require('./images/eagles.png')}
          alt="Go birds"
          style={imageStyle}
        />
        <img
          src={require('./images/sixers.png')}
          alt="76ers"
          style={imageStyle}
        />
        <img
          src={require('./images/flyers.png')}
          alt="Flyers"
          style={imageStyle}
        />
      </div>

      <div style={bioBoxStyle1}>
          <h1>Resume</h1>
      </div>
      <p></p>
      <p></p>
      <p></p>
      <img src={require('./images/resume.png')} alt="resume" style={imageStyle1} />
      <p></p>
      <p></p>
      <p></p>
      </header>
  );
};

const buttonStyle = {
  padding: '10px 50px',
  backgroundColor: '#556',
  color: '#fff',
  border: 'none',
  borderRadius: '10px',
  cursor: 'pointer',
};

const imageContainerStyle = {
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  padding: '100px'
};

const bioimage = {
  width: '15%',
  height: '100%',
  objectFit: 'cover',
  border: '10px solid #531',
  boxShadow: '20px 20px 5px rgba(0, 0, 0, 200)',
};

const imageStyle = {
  width: '15%',
  height: '100%',
  objectFit: 'cover',
};

const imageStyle1 = {
  marginTop: '30px',
  width: '1000px',
  height: '1414px',
  margin: 'auto',
  display: 'block',
};

const bioBoxStyle = {
  marginTop: '100px',
  backgroundColor: '#222',
  textAlign: 'center',
  padding: '20px',
  boxShadow: '20px 20px 5px rgba(0, 0, 0, 200)'
};

const bioBoxStyle1 = {
  height: '100%',
  marginTop: '50px',
  backgroundColor: '#222',
  textAlign: 'center',
  padding: '20px',
  boxShadow: '20px 20px 5px rgba(0, 0, 0, 200)'
};

export default About;
